oxy_webhelp_navlinks = {"d365_protection_setup-d22872e31439":{"topics":[{"title":"Retention Lock for Dynamics 365","shortdesc":"<p class=\"shortdesc\">A retention lock on an <span class=\"ph\">RSC<\/span> SLA Domain is a security feature that         prevents premature deletion of Microsoft Dynamics 365 snapshots.<\/p>","href":"microsoft_dynamics_365\/d365_retention_lock.html","attributes":{"data-id":"d365_retention_lock"},"menu":{"hasChildren":false},"tocID":"d365_retention_lock-d22872e31450","topics":[]},{"title":"Configuration of Dynamics 365 protection","shortdesc":"<p class=\"shortdesc\">To ensure the resilience and availability of your Microsoft Dynamics 365         subscription, it is important to implement a data protection strategy using SLA Domains. Key         actions include creating and assigning SLA Domains to Microsoft Dynamics 365 subscriptions,         deleting unused SLA Domains, and cloning properly configured SLA Domains for         efficiency.<\/p>","href":"microsoft_dynamics_365\/d365_protection_config.html","attributes":{"data-id":"d365_protection_config"},"menu":{"hasChildren":false},"tocID":"d365_protection_config-d22872e31464","next":"d365_protection_config-d22872e31464"}]}};